INSERT INTO subject (finalThank, visibility, createdAt, name, descriptionNative, code, subjectId, organizationId, categoryId, SK, sort, end, description, PK, id, introduction, nameNative, start) VALUES ('<p>Thank you so much for your time to input the afford toward this survey.</p>', '', '2023-11-07T02:52:13.365Z', 'Sample Survey #1', , 'SS#1', 'fa457c46-f7e3-4825-8758-0be89b81579d', 'b740450d-a05d-4e1d-a235-1d507702f30d', '6b9b447c-a46a-4bb1-b1d6-25683d9efae6', 'SUBJECT#fa457c46-f7e3-4825-8758-0be89b81579d', 0, '2023-11-30', 'Sample Survey Subtitle #1', 'ORG#b740450d-a05d-4e1d-a235-1d507702f30d', 'fa457c46-f7e3-4825-8758-0be89b81579d', '<p>While this book serves as a wildly fantastic guide through the broad, sometimes intimidating field of big data and data science, it is not an instruction manual for hands-on implementation. Hereâ€™s what to expect:</p><ul><li>Provides a background in big data and data engineering before moving on to data science and how it's applied to generate value</li><li>Includes coverage of big data frameworks like Hadoop, MapReduce, Spark, MPP platforms, and NoSQL</li><li>Explains machine learning and many of its algorithms as well as artificial intelligence and the evolution of the Internet of Things</li><li>Details data visualization techniques that can be used to showcase, summarize, and communicate the data insights you generate</li></ul><p>It's a big, big data world out thereâ€”let&nbsp;<em>Data Science For Dummies</em>&nbsp;help you harness its power and gain a competitive edge for your organization.</p>', , '2023-11-07');
